// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;

import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {Errors} from "../security/Errors.sol";

/// @notice Escrows collateral for a single market.
contract Vault {
	IERC20 public immutable collateral;
	address public market; // controller set once by factory
	bool private _marketSet;

	mapping(address => uint256) public collateralOf;

	modifier onlyMarket() {
		if (msg.sender != market) revert Errors.OnlyMarket();
		_;
	}

	constructor(address collateral_) {
		if (collateral_ == address(0)) revert Errors.ZeroAddress();
		collateral = IERC20(collateral_);
	}

	function setMarket(address market_) external {
		if (_marketSet) revert Errors.InvalidParameter();
		if (market_ == address(0)) revert Errors.ZeroAddress();
		market = market_;
		_marketSet = true;
	}

	function depositFrom(address payer, uint256 amount) external onlyMarket {
		if (amount == 0) revert Errors.InvalidParameter();
		(bool s) = collateral.transferFrom(payer, address(this), amount);
		if (!s) revert Errors.TransferFailed();
		collateralOf[payer] += amount;
	}

	function withdrawFromTo(address from, address to, uint256 amount) external onlyMarket {
		if (amount == 0) revert Errors.InvalidParameter();
		uint256 bal = collateralOf[from];
		if (bal < amount) revert Errors.InsufficientCollateral();
		collateralOf[from] = bal - amount;
		(bool s) = collateral.transfer(to, amount);
		if (!s) revert Errors.TransferFailed();
	}

	function sweepTo(address to, uint256 amount) external onlyMarket {
		(bool s) = collateral.transfer(to, amount);
		if (!s) revert Errors.TransferFailed();
	}
}

contracts/oracle/VPOOracleChainlink.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;

import {IVPOOracle} from "../interfaces/IVPOOracle.sol";
import {Errors} from "../security/Errors.sol";

/// @title VPO Oracle (Chainlink Functions)
/// @notice Phase 1 oracle that stores attested result + metadata.
contract VPOOracleChainlink is IVPOOracle {
	struct Result {
		bool resolved;
		bytes data; // provider-specific encoding
		bytes metadata; // requestId, timestamps, etc.
	}

	/// @dev marketId => result
	mapping(bytes32 => Result) private _results;

	address public admin;

	modifier onlyAdmin() {
		if (msg.sender != admin) revert Errors.OnlyAdmin();
		_;
	}

	constructor(address admin_) {
		if (admin_ == address(0)) revert Errors.ZeroAddress();
		admin = admin_;
	}

	function requestResolve(bytes32 marketId, bytes calldata extraData) external override {
		emit ResolveRequested(marketId, msg.sender, extraData);
	}

	/// @notice Called by off-chain Functions fulfillment or relayer to store the result.
	function fulfillResult(bytes32 marketId, bytes calldata resultData, bytes calldata metadata)
		external
		onlyAdmin
	{
		_results[marketId] = Result({resolved: true, data: resultData, metadata: metadata});
		emit ResolveFulfilled(marketId, resultData, metadata);
	}

	function getResult(bytes32 marketId)
		external
		view
		override
		returns (bool resolved, bytes memory resultData, bytes memory metadata)
	{
		Result memory r = _results[marketId];
		return (r.resolved, r.data, r.metadata);
	}
}

contracts/security/Errors.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;

library Errors {
	// Access control
	error NotAuthorized();
	error Unauthorized();
	error OnlyAdmin();
	error OnlyMarketManager();
	error OnlyOracleManager();
	error OnlyFactory();
	error OnlyMarket();

	// State
	error MarketAlreadyResolved();
	error MarketNotResolved();
	error TradingClosed();
	error TradingOpen();
	error Paused();
	error NotPaused();

	// Input validation
	error InvalidParameter();
	error InvalidFee();
	error InvalidTime();
	error ZeroAddress();

	// Economic
	error InsufficientBalance();
	error InsufficientCollateral();
	error TransferFailed();

	// Adapter specific
	error NotFound();
	error AlreadyFulfilled();
}

